DROP TABLE IF EXISTS `cities`;
CREATE TABLE `cities` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `departments_id` int(10) unsigned NOT NULL,
  `name` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  `slug` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  `pattern` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  `postal_code` varchar(125) COLLATE utf8mb4_unicode_ci NOT NULL,
  `gps_lat` double(9,4) NOT NULL,
  `gps_lon` double(9,4) NOT NULL,
  PRIMARY KEY (`id`),
  KEY `cities_departments_id_index` (`departments_id`),
  CONSTRAINT `cities_departments_id_foreign` FOREIGN KEY (`departments_id`) REFERENCES `departments` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=36115 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

